import React, { Component } from "react";
import { DragDropContext } from 'react-beautiful-dnd';

class Tasks extends Component {
  render() {
      const{tasks}=this.props
    return (
        <React.Fragment>
            <DragDropContext>
            <ul className='tasks'>
            {tasks.map((task)=>{
      return <li name='task' key={task.id} style={{height:'30px',padding:'10px',border:'1px solid grey',margin:'5px'}}>
        {task.content}
      </li>
            })
        }
            </ul>
            </DragDropContext>
      </React.Fragment>
      
    );
  }
}

export default Tasks;
